import CartIcon from "../Cart/CardIcon";
const HeaderCartButton = props => {
    return (
        <button>
            <span>
                <CartIcon />
            </span>
            <span>Your Order</span>
            <span>3</span>
        </button>
    )
};

export default HeaderCartButton
